function getPicUrl(str) {
    var rand = Math.random();
    var ratio = 0.3;
    if (rand < ratio) {
        str = "https://nc-img.038vg.com" + str;
    } else {
        str = "https://img.610xy.com" + str;
    }
    return str;
}
function getFilmTime(arg) {
    var h = Math.floor(arg/60/60%24);
    var m = Math.floor(arg/60%60);
    var s = Math.floor(arg%60);
    var result = "";
    if (h < 1) {
        result =  m + "分" + s + '秒';
    } else {
        result = h + "小时" + m + "分" + s + '秒';
    }
    if(h==0 && m==0 && s==0){
        result = "";
    }
    return result;
}
